const POSTS_PAGE_URL = '/posts' // Change this to your actual route if using React Router

const Posts = () => {
  const handleClick = () => {
    window.location.href = POSTS_PAGE_URL
  }

  return (
    <section className='section posts' id='posts'>
      <h2 className='section__title'>글모음</h2>
      <div style={{ display: 'flex', justifyContent: 'center', marginBottom: '1em' }}>
        <button
          type="button"
          onClick={handleClick}
          style={{
            border: '1px solid #ccc',
            borderRadius: '6px',
            padding: '0.5em 1em',
            width: '350px', // Match skills box width
            background: '#fff',
            color: '#222',
            textAlign: 'center',
            fontWeight: 'bold',
            fontSize: '1.1em',
            boxSizing: 'border-box',
            cursor: 'pointer'
          }}
        >
          글모음 페이지로 이동
        </button>
      </div>
    </section>
  )
}
